.bounce {
    position: absolute;
    bottom: 30px;
    left: 50% ;
    width: 45px;
    height: 57px ;
    margin-left:-30px;
    animation: bounce 2s infinite;
    -webkit-animation: bounce 2s infinite;
    -moz-animation: bounce 2s infinite;
    -o-animation: bounce 2s infinite;
}
@-webkit-keyframes bounce {
    0%, 20%, 50%, 80%, 100% {-webkit-transform: translateY(0);} 
    40% {-webkit-transform: translateY(-30px);}
    60% {-webkit-transform: translateY(-15px);}
}
 
@-moz-keyframes bounce {
    0%, 20%, 50%, 80%, 100% {-moz-transform: translateY(0);}
    40% {-moz-transform: translateY(-30px);}
    60% {-moz-transform: translateY(-15px);}
}
 
@-o-keyframes bounce {
    0%, 20%, 50%, 80%, 100% {-o-transform: translateY(0);}
    40% {-o-transform: translateY(-30px);}
    60% {-o-transform: translateY(-15px);}
}
@keyframes bounce {
    0%, 20%, 50%, 80%, 100% {transform: translateY(0);}
    40% {transform: translateY(-30px);}
    60% {transform: translateY(-15px);}
}
.slick-dots {
    bottom: 30px;
}
.slick-dots li button:before {
    font-size: 10px;
    color: white;
}
.slick-dots li.slick-active button:before {
    color: white;
}
html{
  scroll-behavior: smooth;
}
.scroll-down-section {
    scroll-margin-top: 100px !important;
}

#myVideo {
  position: relative;
  right: 0;
  bottom: 0;
  min-width: 100%; 
  min-height: 100%;
}
.video-content {
  position: absolute;
  top: 50px;
  color: #fff;
  width: 100%;
  padding: 20px;
}
.left-content {
  width:50%;
  float:left;
  text-align:center;
}
.right-content {
  width:35%;
  float:left;
  text-shadow: 0.08em 0.08em 0.08em #000000;
}
.left-content h2 {
  font-size: 40px;
}
.right-content h3 {
    font-size: 25px;
    margin-bottom: 10px;
}
.right-content p {
    font-size: 22px;
    margin-bottom: 10px;
    margin-top: 10px;
}
.arrow-head {
    position: relative;
    padding-bottom: 2.8rem;
}
.arrow-head:after {
    position: absolute;
    left: 50%;
    transform: translate(-50%);
    -webkit-transform: translate(-50%);
    -ms-transform: translate(-50%);
    bottom: 0;
    content: url(https://futureproofadvisors.com/wp-content/uploads/2022/01/shape-light-to-dark.svg);
}
.arrow-left:after {
    left: 0;
    transform: none;
}
.arrow-head-white:after {
    content: url(https://futureproofadvisors.com/wp-content/uploads/2021/10/text-shape-white.svg);
}
.arrow-head.left-head {
    display: inline-block;
}
.button-blue:after {
    content: url(https://futureproofadvisors.com/wp-content/uploads/2021/10/button-shape.svg);
    opacity: 1;
    right: 25px;
    margin-left: 0;
    top: 18px;
    position: absolute;
}
.button-blue {
  padding: 15px 50px 15px 25px;
